import{_ as e,c as r,o as a,a4 as o}from"./chunks/framework.DBIahkuf.js";const i="/AINotes/assets/4187c253f7be4fb09e88d9793e31cb83tplv-k3u1fbpfcp-zoom-in-crop-mark1512000.bOTd_rmP.webp",b=JSON.parse('{"title":"Midjourney AI绘画工具的使用","description":"","frontmatter":{},"headers":[],"relativePath":"Document/AI绘画工具/Midjourney AI绘画工具/5.Midjourney工具的使用.md","filePath":"Document/AI绘画工具/Midjourney AI绘画工具/5.Midjourney工具的使用.md","lastUpdated":1708941732000}'),t={name:"Document/AI绘画工具/Midjourney AI绘画工具/5.Midjourney工具的使用.md"},n=o('<h1 id="midjourney-ai绘画工具的使用" tabindex="-1">Midjourney AI绘画工具的使用 <a class="header-anchor" href="#midjourney-ai绘画工具的使用" aria-label="Permalink to &quot;Midjourney AI绘画工具的使用&quot;">​</a></h1><p>Midjourney 中文社区 飞书文档链接：<a href="https://ja57xhnzz2n.feishu.cn/wiki/wikcnBeEslS7aRUvGRYFonV2ynd" target="_blank" rel="noreferrer">https://ja57xhnzz2n.feishu.cn/wiki/wikcnBeEslS7aRUvGRYFonV2ynd</a> 密码: kiJ7</p><p>midjoumey官网使用手册(英文)：<a href="https://docs.midjoumey.com" target="_blank" rel="noreferrer">https://docs.midjoumey.com</a></p><h2 id="教程" tabindex="-1">教程 <a class="header-anchor" href="#教程" aria-label="Permalink to &quot;教程&quot;">​</a></h2><p><a href="https://ssw9noe1h6.feishu.cn/wiki/wikcn5LLVhHZ8G8AsaiiRsOpEYf" target="_blank" rel="noreferrer">‌⁤‌⁣‌⁣‌‍⁡⁢⁤⁡‌‍⁢⁡⁢⁤‌Midjourney 学习导航 - 飞书云文档 (feishu.cn)</a></p><p><a href="https://tob-design.yuque.com/kxcufk/mj" target="_blank" rel="noreferrer">Midjourney 知识库 (yuque.com)</a></p><p><a href="https://zhuanlan.zhihu.com/p/611864651" target="_blank" rel="noreferrer">Midjourney教程：超详细Ai绘画新手入门攻略（附学习资源工具大全）干货合集，建议收藏 - 知乎 (zhihu.com)</a></p><p><a href="https://xikr8g3owj.feishu.cn/docx/VYXOdUvGooF2MTxnN2cc7a4Mnuh" target="_blank" rel="noreferrer">‌\uFEFF⁢‬‬⁡⁢‌‬⁤‍‍⁡‌‍⁡‬⁤‬\uFEFF‌‬⁤⁤⁢⁢\uFEFF‌⁣‬⁢\uFEFF⁤⁣⁡‍⁢‍⁢⁤⁢\uFEFF‬⁡拍张证件照200元？Midjourney免费给你做一张 - 飞书云文档 (feishu.cn)</a></p><p><a href="https://zhuanlan.zhihu.com/p/611864651" target="_blank" rel="noreferrer">Midjourney教程：超详细Ai绘画新手入门攻略（附学习资源工具大全）干货合集，建议收藏 - 知乎 (zhihu.com)</a></p><p>——————————————————————————————————————</p><p><strong>Midjourney 学习导航</strong>：<a href="https://learningprompt.wiki/docs/midjourney-learning-path" target="_blank" rel="noreferrer">🧭 Midjourney 学习导航 | Learning Prompt</a></p><p><a href="https://mp.weixin.qq.com/s/pDR54zUCdwzcyG7tU2IcEg" target="_blank" rel="noreferrer">Midjourney｜活动海报落地设计流程 (qq.com)</a></p><p><a href="https://mp.weixin.qq.com/s/dLkoNpXAI51U9uc9IWhphA" target="_blank" rel="noreferrer">我嫌ai出图效率太低，又研究了一下进阶玩法！ (qq.com)</a></p><p><a href="https://www.bilibili.com/video/BV1wW4y1G7a3/?share_source=copy_web&amp;vd_source=b68f853f829d65fae4ec428042e47343" target="_blank" rel="noreferrer">人类还剩几集可以逃？ChatGPT + Midjourney + Clipchamp AI大军联合玩内容创作 (文稿/插图/配乐/配音/字幕全包)</a></p><p><a href="https://mp.weixin.qq.com/s/b1v2Jp04119bDeyuBLv_Iw" target="_blank" rel="noreferrer">2天300+作品，Midjourney将彻底颠覆食品包装设计！</a></p><h2 id="midjourney-正式上线局部重绘功能-vary-region" tabindex="-1">Midjourney 正式上线局部重绘功能 Vary (Region) <a class="header-anchor" href="#midjourney-正式上线局部重绘功能-vary-region" aria-label="Permalink to &quot;Midjourney 正式上线局部重绘功能 Vary (Region)&quot;">​</a></h2><p><img src="'+i+'" alt="img"></p><p>8月22日，Midjourney 正式上线了局部重绘功能，官方称之为 「Vary (Region)」，允许对生成图像的选定区域进行选择，并重新输入 Prompt 进行重新绘制，以下是操作步骤：</p><blockquote><ol><li>使用 <code>/imagine</code> 命令创建图像</li><li>点击 U 按钮放大选定图像</li><li>点击 Vary (Region) 按钮，打开编辑界面</li><li>选择要重新生成的图像区域</li><li>提交并查看结果 <a href="https://docs.midjourney.com/docs/vary-region" target="_blank" rel="noreferrer"><strong>⋙ Midjourney文档</strong></a> | <a href="https://mp.weixin.qq.com/s/DWWYQHpGMGY2IeOahNeC2g" target="_blank" rel="noreferrer">Midjourney发布局部修复功能，这里有一份6000字的使用指南 (qq.com)</a></li></ol></blockquote><h2 id="slack-可以添加使用midjourney-无魔法免费体验" tabindex="-1">Slack 可以添加使用MidJourney ，无魔法免费体验 <a class="header-anchor" href="#slack-可以添加使用midjourney-无魔法免费体验" aria-label="Permalink to &quot;Slack 可以添加使用MidJourney ，无魔法免费体验&quot;">​</a></h2><p><img src="https://p3-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/dfc5e579275745b9b50e8f68ed0a65cb~tplv-k3u1fbpfcp-zoom-in-crop-mark:1512:0:0:0.awebp" alt="img"></p><p>MidJorney 是目前最受欢迎的AI绘图工具之一，可以根据用户输入的文本提示词，生成高质量图片。Slack 是一款企业内部通信工具，可以轻松集成很多第三项服务，比如 Notion、Claude、GitHub、Trello 等。</p><p>最新消息是，MidJorney 可以添加到 Slack 并免费体验。这意味着 Slack 用户可以更便捷地使用MJ的文生图功能，且无需魔法！ <a href="https://t.zsxq.com/0eDQ8YZ6j" target="_blank" rel="noreferrer"><strong>⋙ 详细操作教程</strong></a> | <a href="https://www.mjslackbot.com/" target="_blank" rel="noreferrer"><strong>添加至Slack</strong></a></p><h2 id="billfish素材管家" tabindex="-1">Billfish素材管家 <a class="header-anchor" href="#billfish素材管家" aria-label="Permalink to &quot;Billfish素材管家&quot;">​</a></h2><p>我们还可以借助免费的Billfish素材管家，来对我们的AI作品进行管理以下是使用 Billfish素材管家管理AI画作的步骤：</p><p>1、下载并安装 Billfish素材管家软件，并登录您的账户。</p><p>**2、导入 AI 画作：**在软件界面中选择 &quot;导入&quot;，然后选择您想要导入的 AI 画作文件夹。Billfish素材管家 支持多种类型的 AI 文件，如 SVG、EPS 和 AI 等格式。</p><p><img src="https://pics7.baidu.com/feed/a50f4bfbfbedab642055c914d26254c878311e9a.jpeg@f_auto?token=38feab42b8389cfb5eb6a3699c873111" alt="img"></p><p>**3、分类：**导入完成后，Billfish素材管家 会自动将所有图片进行分类，并进行关键词标记。您还可以通过添加自定义标签来进一步分类和组织您的画作。</p><p>**4、搜索和浏览：**可以使用关键词搜索功能查找特定的画作，也可以通过不同的分类标签来浏览您的画作集合。</p><p><img src="https://pics3.baidu.com/feed/d833c895d143ad4b5cc64dcda456a1a4a50f06b6.jpeg@f_auto?token=3b00fa77804ca6986d157e76ab1fdbfc" alt="img"></p><p>总之，Billfish素材管家 是一款非常实用的画作管理工具，可以帮助您轻松地管理和组织大量的 AI 画作。无论您是个人用户还是团队，都可以通过这个工具提高工作效率和创作品质。</p><h2 id="midjourney-功能更新资讯" tabindex="-1">Midjourney 功能更新资讯 <a class="header-anchor" href="#midjourney-功能更新资讯" aria-label="Permalink to &quot;Midjourney 功能更新资讯&quot;">​</a></h2><h3 id="midjourney-推出-pan-功能-上下左右-可以平移扩展图片场景" tabindex="-1">Midjourney 推出 pan 功能，上下左右，可以平移扩展图片场景 <a class="header-anchor" href="#midjourney-推出-pan-功能-上下左右-可以平移扩展图片场景" aria-label="Permalink to &quot;Midjourney 推出 pan 功能，上下左右，可以平移扩展图片场景&quot;">​</a></h3><p><img src="https://p3-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/e0cb5b67785f46ca83e6963309833317~tplv-k3u1fbpfcp-zoom-in-crop-mark:1512:0:0:0.awebp" alt="img"></p><p>7月4日，Midjourney 宣布正在测试名为「<strong>panning (平移)</strong>」的新功能，可以按指定的上下左右方向，拓展生成图片的外部场景。这也使得「<strong>outpainting (补全)</strong>」功能更加强大。</p><p>用户生成图片后，下方菜单栏会出现⬅➡⬆⬇四个按钮，点击某个箭头后，图片就会按照这个方向进行拓展补全。不过此项功能当前还有一些限制，需要更多的后续开发完善 <a href="https://twitter.com/midjourney/status/1675969584229412864" target="_blank" rel="noreferrer"><strong>⋙ Twitter @Midjourney</strong></a></p>',37),p=[n];function l(c,s,d,h,u,f){return a(),r("div",null,p)}const y=e(t,[["render",l]]);export{b as __pageData,y as default};
